import React, { useState, useEffect } from "react";
import axios from "axios";
import ReactDOMServer from "react-dom/server"; // Import the ReactDOMServer module
import { API_URL } from "../Components/Shared";
import LogoSvg from "./LogoSvg";

const AccountGenerationEmail = ({
  userEmailAddress,
  setResetPasswordRequest,
}) => {
  const [accountCreationStatus, setAccountCreationStatus] = useState({
    loading: true,
  });
  const [isEmailSent, setIsEmailSent] = useState(false);

  const introductoryMessage = `
    Solana offers high-speed peer-to-peer payments through its innovative blockchain technology, 
    designed to handle thousands of transactions per second (TPS) with low transaction fees. 
    By utilizing a unique consensus mechanism called Proof of History, combined with Proof of Stake.
    At VEND, we've leveraged these payment rails to make it easy for you, the business owner, to reap
    the rewards without having to pay the overhead fees associated with other, more modern systems.  
    If you are familiar with the Solana blockchain, feel free to skip this.  If you aren't, no worries,
    we have designed this with you in mind. To get started, we would recommend that you stick with our default
    payment method - PYUSD.  This is a specific US Dollar backed stablecoin that has been issued by PayPal.
    Through PayPal's interface, this can easily be exchanged for dollars. 
    `;

  const emailConfirmationMessage = `Congratulations! Your account has been created!
    You can click the link below to continue to our Point of Sale Interface and finish setting up your account.  We have developed this with simplicity in mind and our hope is that you can personalize your interface.  
    At VEND, we want you to be able to be a part of this experience.  If you want to keep it basic, keep it basic, if you want to make it your own, by all means.  We are here to support you and we thank you for your interest in our product!`;

  const paragraphStyles = {
    fontSize: "18px",
    fontWeight: "bold",
    color: "#525852",
    textAlign: "center",
    padding: "20px",
    borderRadius: "4px",
    backgroundColor: "#f0f9f4",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    width: "500px",
    margin: "0 auto",
    lineHeight: "1.5",
  };

  const emailHtmlContent = () => {
    return `<!DOCTYPE html>
<html>
<head>
    <title>Account Confirmation Email</title>
</head>
<body style="font-family: Arial, sans-serif; margin: 0; padding: 0; color: #333; background-color: #ffffff;  background-attachment: fixed; background-size: cover;">
    <div style="width: 100%; max-width: 600px; margin: 20px auto; background-color: #ffffff57; padding: 20px; border-radius: 8px; box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);">
        <div style="text-align:center;">
            <img src= "data:image/jpeg;base64,"' style="width: 75px; border-radius:7.5px;">
        </div>
        <div style="text-align: center; padding: 20px 0; border-bottom: 1px solid #eee;">
            <h1 style="margin: 0;">Welcome to VEND!</h1>
        </div>
        <div style="padding: 20px;">
            <p style="margin: 0;">Congratulations! Your account has been created!</p>
            <p style="margin: 0;">Click the link below to log-in and finish setting up your account.</p>
            <p style="margin: 0; text-align:center;"><a href="https://www.solvend.fun/#HASH_KEY" style="display: inline-block; padding: 10px 20px; background-color: #663399; color: #fff; text-decoration: none; border-radius: 5px;">Continue to VEND</a></p>
        </div>
        <div style="text-align: center; padding: 20px; border-top: 1px solid #eee; color: #777;">
            <p style="margin: 0;">Thank you for joining us!</p>
        </div>
    </div>
</body>
</html>`;
  };

  const handleSubmit = async (e) => {
    console.log(JSON.stringify(emailHtmlContent()))
    const formData = {
      emailAddress: userEmailAddress,
      htmlContent: JSON.stringify(emailHtmlContent()),
    };
    await axios
      .post(`${API_URL}/api/send_confirmation_email`, formData)
      .then((response) => {
        setAccountCreationStatus(response.data);
      })
      .catch((error) => {
        if (error.response) {
          try {
            setAccountCreationStatus({ error: error.response.data.error });
          } catch {
            setAccountCreationStatus({
              error: "An error occurred before account creation.",
            });
          }
        } else {
          setAccountCreationStatus({
            error: "An error occurred before account creation.",
          });
        }
      });
  };
  if (!isEmailSent) {
    handleSubmit();
    setIsEmailSent(true);
  }
  return (
    <div>
      {accountCreationStatus.doContinue && (
        <div className="success-container">
          <div className="success-message-box">
            <h2 className="success-heading">Signup Successful!</h2>
            <p className="success-message">
              Congratulations! Your signup was successful.
            </p>
            <p className="success-message">
              A verification email has been sent to your email address. Please
              check your inbox (and spam folder) for a link to verify your
              account and complete the registration process.
            </p>
            <p className="success-footer">Thank you for joining us!</p>
          </div>
        </div>
      )}
      {Object.keys(accountCreationStatus).includes("doContinue") &&
        !accountCreationStatus.doContinue && (
          <div className="account-exists-container">
            <div className="success-message-box">
              <h2 className="success-heading">Account Already Exists</h2>
              <p className="success-message">
                It looks like an account with this email address already exists.
                If you've forgotten your password, you can reset it.
              </p>
              <p className="success-footer">
                <p
                  onClick={() => {
                    setResetPasswordRequest(true);
                  }}
                  onMouseEnter={(e) => (e.target.style.color = "#0056b3")} // Mouse hover effect
                  onMouseLeave={(e) => (e.target.style.color = "#007BFF")} // Mouse out effect
                  style={{ cursor: "pointer", color: "#007BFF" }}
                >
                  Reset your password?
                </p>
              </p>
            </div>
          </div>
        )}
      {accountCreationStatus.error && (
        <div className="server-error-container">
          <div className="success-message-box">
            <h2 className="success-heading">Oops! Something Went Wrong</h2>
            <p className="success-message">{accountCreationStatus.error}</p>
            <p className="success-message">
              Please try again later. If the issue persists, contact support.
            </p>
          </div>
        </div>
      )}
      {accountCreationStatus.loading && (
        <div
          className="modal-overlay"
          style={{
            display: "flex",
            alignItems: "center",
            background: "rgb(0 0 0 / 75%)",
          }}
        >
          <div className="modal">
            <div className="loading-dialog">
              <p>Loading...</p>
              <div className="spinner" style={{ marginLeft: "15%" }}></div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AccountGenerationEmail;
